const Header = (props) => {
  return (
    <div>
      <h1>{props.course.name}</h1> {/* tulostaa kurssien otsikot */}
    </div>
  )
}

const Contents = (props) => {
  return (
    <div>
      <Osa 
        osa1={props.parts.parts[0].name} /* osion nimi */
        harjoitus1={props.parts.parts[0].exercises} /* osion tehtävät */
      />
      <Osa 
        osa2={props.parts.parts[1].name} /* osion nimi */
        harjoitus2={props.parts.parts[1].exercises} /* osion tehtävät */
      />
      <Osa 
        osa3={props.parts.parts[2].name} /* osion nimi */
        harjoitus3={props.parts.parts[2].exercises} /* osion tehtävät */
      />
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      {
        <p>Number of exercises[" "} 
          {props.parts.parts[0]}
        </p>
      }
      tehtävien määrä: 
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Contents osa={part1}/>
      <Total />

      <p>
        {part1} {exercises1}
      </p>
      <p>
        {part2} {exercises2}
      </p>
      <p>
        {part3} {exercises3}
      </p>
      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

export default App
